import React, { useState } from 'react';

const Login = () => {
  //ASSETS
  const BackgroundBK = require('./../../assets/Image/backgroundBK.jpeg');
  const logoBK = require('./../../assets/Image/logoBK.png');

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handlePasswordChange = (event) => {
    setPassword(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Perform login logic here
    console.log('Email:', email);
    console.log('Password:', password);
    // Reset form
    setEmail('');
    setPassword('');
  };

  return (
    <main className="flex-col justify-center items-center border overflow-hidden relative flex min-h-[1024px] px-5 border-solid border-black">
      <img loading="lazy" src={BackgroundBK} className="h-full w-full object-cover object-center inset-0" />

      <section className="relative bg-white flex w-[528px] max-w-full flex-col items-center mt-20 mb-56 pl-10 pr-10 py-6 rounded-3xl max-md:my-10 max-md:px-5">
        <img loading="lazy" srcSet="https://cdn.builder.io/api/v1/image/assets/TEMP/07202251-231e-440b-8cfa-4ff8e1956985?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=100 100w, https://cdn.builder.io/api/v1/image/assets/TEMP/07202251-231e-440b-8cfa-4ff8e1956985?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=200 200w, https://cdn.builder.io/api/v1/image/assets/TEMP/07202251-231e-440b-8cfa-4ff8e1956985?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=400 400w, https://cdn.builder.io/api/v1/image/assets/TEMP/07202251-231e-440b-8cfa-4ff8e1956985?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=800 800w, https://cdn.builder.io/api/v1/image/assets/TEMP/07202251-231e-440b-8cfa-4ff8e1956985?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=1200 1200w, https://cdn.builder.io/api/v1/image/assets/TEMP/07202251-231e-440b-8cfa-4ff8e1956985?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=1600 1600w, https://cdn.builder.io/api/v1/image/assets/TEMP/07202251-231e-440b-8cfa-4ff8e1956985?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=2000 2000w, https://cdn.builder.io/api/v1/image/assets/TEMP/07202251-231e-440b-8cfa-4ff8e1956985?apiKey=5eee8e5597a74884b2ae231bd09a91a5&"className="aspect-[1.01] object-contain object-center w-20 overflow-hidden max-w-full" />

        <div className="text-sky-700 text-lg leading-7 whitespace-nowrap mt-6">
          <span className="text-black">Bạn chưa có tài khoản ? </span>
          <span className="text-sky-700"> Đăng kí ngay</span>
          <span className="text-black"> </span>
        </div>

        <div className="flex w-[278px] max-w-full items-stretch gap-1.5 mt-5">
          <img loading="lazy" srcSet="https://cdn.builder.io/api/v1/image/assets/TEMP/5736e9f7-956b-4be8-94be-71e2d46dcc78?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=100 100w, https://cdn.builder.io/api/v1/image/assets/TEMP/5736e9f7-956b-4be8-94be-71e2d46dcc78?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=200 200w, https://cdn.builder.io/api/v1/image/assets/TEMP/5736e9f7-956b-4be8-94be-71e2d46dcc78?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=400 400w, https://cdn.builder.io/api/v1/image/assets/TEMP/5736e9f7-956b-4be8-94be-71e2d46dcc78?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=800 800w, https://cdn.builder.io/api/v1/image/assets/TEMP/5736e9f7-956b-4be8-94be-71e2d46dcc78?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=1200 1200w, https://cdn.builder.io/api/v1/image/assets/TEMP/5736e9f7-956b-4be8-94be-71e2d46dcc78?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=1600 1600w, https://cdn.builder.io/api/v1/image/assets/TEMP/5736e9f7-956b-4be8-94be-71e2d46dcc78?apiKey=5eee8e5597a74884b2ae231bd09a91a5&width=2000 2000w, https://cdn.builder.io/api/v1/image/assets/TEMP/5736e9f7-956b-4be8-94be-71e2d46dcc78?apiKey=5eee8e5597a74884b2ae231bd09a91a5&"className="aspect-[0.9] object-contain object-center w-[54px] overflow-hidden shrink-0 max-w-full" />
          <div className="text-black text-lg leading-7 self-center whitespace-nowrap my-auto">
            <a href="...">Đăng nhập bằng Google</a>
          </div>
        </div>

        <div className="self-stretch flex items-stretch justify-between gap-0 mt-6 max-md:max-w-full max-md:flex-wrap">
          <div className="flex w-[198px] shrink-0 h-[22px] flex-col border-b-black border-b border-solid" />
          <div className="flex grow basis-[0%] flex-col items-stretch py-0.5">
            <div className="z-[1] flex shrink-0 h-[22px] flex-col border-b-black border-b border-solid" />
            <div className="text-black text-lg leading-7 whitespace-nowrap -mt-5 mb-1">Hoặc</div>
          </div>
        </div>

        <label htmlFor="email" className="text-black text-lg leading-6 self-stretch whitespace-nowrap mt-7 max-md:max-w-full">
          Email
        </label>
        <input
          type="email"
          id="email"
          className="text-zinc-500 text-base font-light leading-6 max-w-[325px] border bg-white self-stretch mt-6 px-5 py-6 rounded-lg border-solid border-zinc-400 max-md:max-w-full max-md:pl-1.5"
          value="admin@hcmut.edu.vn"
          readOnly
        />

        <label htmlFor="password" className="text-black text-lg leading-6 self-stretch whitespace-nowrap mt-6 max-md:max-w-full">
          Mật khẩu
        </label>
        <input
          type="password"
          id="password"
          className="text-zinc-500 text-base font-light leading-6 max-w-[325px] border bg-white self-stretch mt-5 px-5 py-7 rounded-lg border-solid border-zinc-400 max-md:max-w-full max-md:pl-1.5"
          value="************"
          readOnly
        />

        <button className="text-white text-lg font-medium leading-6 whitespace-nowrap shadow-lg bg-sky-700 w-[236px] max-w-full items-center mt-7 px-5 py-5 rounded-xl">
          Đăng nhập
        </button>

        <div className="text-sky-700 text-lg font-medium leading-6 whitespace-nowrap mt-6">
          <a href="...">Quên mật khẩu?</a>
        </div>
      </section>
    </main>
  );
};

export default Login;
